description = "Experimental WASI API bindings for Rust"
license = "Apache-2.0 WITH LLVM-exception OR Apache-2.0 OR MIT"
authors = ["The Cranelift Project Developers"]
repository = "https://github.com/bytecodealliance/wasi"

[[dependencies]]
name = "wasm-bindgen"
version = "0.2.88"
description = """
Easy support for interacting between JS and Rust.
"""
license = "MIT OR Apache-2.0"
notices = ["Copyright (c) 2014 Alex Crichton"]
authors = ["The wasm-bindgen Developers"]
repository = "https://github.com/rustwasm/wasm-bindgen"
homepage = "https://rustwasm.github.io/"

[[dependencies]]
name = "wasm-bindgen-backend"
version = "0.2.88"
description = """
Backend code generation of the wasm-bindgen tool
"""
license = "MIT OR Apache-2.0"
notices = ["Copyright (c) 2014 Alex Crichton"]
authors = ["The wasm-bindgen Developers"]
repository = "https://github.com/rustwasm/wasm-bindgen/tree/master/crates/backend"
homepage = "https://rustwasm.github.io/wasm-bindgen/"

[[dependencies]]
name = "wasm-bindgen-futures"
version = "0.4.38"
description = "Bridging the gap between Rust Futures and JavaScript Promises"
license = "MIT OR Apache-2.0"
notices = ["Copyright (c) 2014 Alex Crichton"]
authors = ["The wasm-bindgen Developers"]
repository = "https://github.com/rustwasm/wasm-bindgen/tree/master/crates/futures"
homepage = "https://rustwasm.github.io/wasm-bindgen/"

[[dependencies]]
name = "wasm-bindgen-macro"
version = "0.2.88"
description = """
Definition of the `#[wasm_bindgen]` attribute, an internal dependency
"""
license = "MIT OR Apache-2.0"
notices = ["Copyright (c) 2014 Alex Crichton"]
authors = ["The wasm-bindgen Developers"]
repository = "https://github.com/rustwasm/wasm-bindgen/tree/master/crates/macro"
homepage = "https://rustwasm.github.io/wasm-bindgen/"

[[dependencies]]
name = "wasm-bindgen-macro-support"
version = "0.2.88"
description = """
The part of the implementation of the `#[wasm_bindgen]` attribute that is not in the shared backend crate
"""
license = "MIT OR Apache-2.0"
notices = ["Copyright (c) 2014 Alex Crichton"]
authors = ["The wasm-bindgen Developers"]
repository = "https://github.com/rustwasm/wasm-bindgen/tree/master/crates/macro-support"
homepage = "https://rustwasm.github.io/wasm-bindgen/"

[[dependencies]]
name = "wasm-bindgen-shared"
version = "0.2.88"
description = """
Shared support between wasm-bindgen and wasm-bindgen cli, an internal
dependency.
"""
license = "MIT OR Apache-2.0"
notices = ["Copyright (c) 2014 Alex Crichton"]
authors = ["The wasm-bindgen Developers"]
repository = "https://github.com/rustwasm/wasm-bindgen/tree/master/crates/shared"
homepage = "https://rustwasm.github.io/wasm-bindgen/"

[[dependencies]]
name = "web-sys"
version = "0.3.65"
description = """
Bindings for all Web APIs, a procedurally generated crate from WebIDL
"""
license = "MIT OR Apache-2.0"
notices = ["Copyright (c) 2014 Alex Crichton"]
authors = ["The wasm-bindgen Developers"]
repository = "https://github.com/rustwasm/wasm-bindgen/tree/master/crates/web-sys"
homepage = "https://rustwasm.github.io/wasm-bindgen/web-sys/index.html"

[[dependencies]]
name = "winapi"
